   flex: 1;
   background-color: #202020;
   height: 100vh;
   color: #ffff;
`;

const Wrapper = styled.div`
   padding: 18px 26px;
`;

const Logo = styled.div`
   display: flex;
   align-items: center;
   gap: 5px;
`;

const Img = styled.img`
   
`

const Menu = () => {
  return (
    <Container>
        <Wrapper>
            Items
        </Wrapper>
    </Container>
  )
}

export default Menu
